import React from 'react';
import { Box } from '@mui/material';
import { Typography } from '@mui/joy';
import CardBasked from './CardBasked';
import Button from '@mui/material/Button';

export default function SaleBasket() {
  return (
    <Box display={'flex'} flexDirection={'column'} sx>
      <Typography textAlign={'center'}>Ваш заказ</Typography>
      <Box display={'flex'} flexDirection={'row'} gap={'30px'} >
        <CardBasked />
        <Box gap={'10px'} display={'flex'} flexDirection={'column'} justifyContent={'flex-end'}>
          <Button variant='contained' color='success'>
            Оформить заказ
          </Button>
          <Button variant='outlined' color='error'>
            Очистить корзину
          </Button>
        </Box>
      </Box>
    </Box>
  );
}
